import React from "react";

class DashForm extends React.Component {
  state = {
    title: "hello",
    style: 3,
    budget: "",
    timeline: "",
    factory: "",
    projectDetails: "",
    reference: []
  };

  render() {
    return (
      <form>
        <input
          placeholder='title'
          value={this.state.title}
          onChange={e => this.setState({ title: e.target.value })}
        />
      </form>
    );
  }
}

export default DashForm;
